  label: \"Behind Sch. Act's %\",           color: \"brown\" },\n      { key: \"CRTITICAL_PERC\",      label: \"Critical Act's %\",       color: \"black\" },\n      \n    ];\n    \n    // Build additional gauges into an array\n    var gaugesArray = [];\n    for (var i = 0; i &lt; fields.length; i++) {\n      var f = fields[i];\n      var val = convertToNumber(data[f.key][index]);\n      gaugesArray.push(createGaugeContainer(val, f.label, f.color));\n    }\n    \n    // Organize additional gauges into rows of 3 per row\n    var gaugesPerRow = 3;\n    var additionalRows = \"\";\n    for (var i = 0; i &lt; gaugesArray.length; i++) {\n      if (i % gaugesPerRow === 0) {\n        additionalRows += '&lt;div style=\"width:100%; text-align:center;\"&gt;';\n      }\n      additionalRows += gaugesArray[i];\n      if ((i + 1) % gaugesPerRow === 0 || i === gaugesArray.length - 1) {\n        additionalRows += '&lt;/div&gt;';\n      }\n    }\n    \n    // Combine main gauges and additional rows inside a full-width, centered container\n    var allGauges_html = '&lt;div style=\"width:100%; margin:0 auto; text-align:center;\"&gt;' +\n                          '&lt;div style=\"width:100%; text-align:center;\"&gt;' + mainGauges_html + '&lt;/div&gt;' +\n                          additionalRows +\n                          '&lt;/div&gt;';\n    \n    gauge_div.text = allGauges_html;\n  "}}]]]},"title":"Select Project","options":["All","S03 | Central Logistics Campus | Catering Facility","I03 |  ICT Infrastructure","I04 | District Cooling Plants","I11 | Integrated  Waste Management Facility (IWMF)","I07 | Power Network, Sub Sea Cable &amp; Substation","I10 | Waste Water Networks","T19  | Shura Mock-ups- By Gajraj Mani","S11 | Start Up Transportation Hub (SUTH)","S10 | Start Up Distribution Center (SUDC)","S00 | Central Logistics Campus | Site-Wide Infrastructure","S08 | Central Logistics Campus | Central Fire Station","T08 | Enabling &amp; Earthworks","I18 | Site Wide Marine Works","I17 | ;\n        return `hsl(${hue}, 70%, 50%)`;\n    });\n\n    // Generate pie chart HTML\n    var pie_html = '&lt;div style=\"display: flex; justify-content: center; align-items: center; height: 100%;\"&gt;';\n    pie_html += '&lt;svg width=\"1400\" height=\"1400\" viewBox=\"-3 -3 64 64\"&gt;';\n\n    var radius = 200; // Reduce the radius to make the pie smaller\n    var cumulativePercent = 0;\n\n    for (var i = 0; i &lt; sizes.length; i++) {\n        var startPercent = cumulativePercent;\n        cumulativePercent += sizes[i];\n        var startAngle = 2 * Math.PI * startPercent;\n        var endAngle = 2 * Math.PI * cumulativePercent;\n\n        // Calculate SVG path with curved edges\n        var x1 = Math.cos(startAngle) * 16 + 16;\n        var y1 = Math.sin(startAngle) * 16 + 16;\n        var x2 = Math.cos(endAngle) * 16 + 16;\n        var y2 = Math.sin(endAngle) * 16 + 16;\n        var largeArcFlag = sizes[i] &gt; 0.5 ? 1 : 0;\n\n        var path = `M16,16 L${x1},${y1} A16,16 0 ${largeArcFlag},1 ${x2},${y2} Z`;\n        var color = uniqueColors[i];\n        pie_html += `&lt;path d=\"${path}\" fill=\"${color}\" stroke=\"#FFFFFF\" stroke-width=\"0.2\"&gt;&lt;/path&gt;`;\n\n        // Calculate position for value inside the slice\n        var midAngle = startAngle + (endAngle - startAngle) / 2;\n        var valueX = Math.cos(midAngle) * 8 + 16; // Position inside the slice\n        var valueY = Math.sin(midAngle) * 8 + 16; // Position inside the slice\n        pie_html += `&lt;text x=\"${valueX}\" y=\"${valueY}\" fill=\"white\" font-size=\"0.6\" text-anchor=\"middle\"&gt;${(sizes[i] * 100).toFixed(1)}%&lt;/text&gt;`;\n    }\n    pie_html += '&lt;/svg&gt;&lt;/div&gt;';\n\n    pie_chart_div.text = pie_html;\n\n    // Update legend table data\n    var legendData = {\n        color: uniqueColors,\n        wbs: labels,\n        percentage: sizes.map(size =&gt; (size * 100).toFixed(1) + \"%\")\n    };\n    legendSource.data = legendData;\n    "}},{"type":"object","name" ;\n          var cy = svgSize / 2;\n          var circumference = 2 * Math.PI * radius;\n          var strokeDasharray = (value / 100) * circumference;\n          return '&lt;div style=\"display:inline-block; text-align:center; margin:20px; width:' + svgSize + 'px;\"&gt;' +\n                    '&lt;h4 style=\"margin:0 0 5px 0;\"&gt;' + title + '&lt;/h4&gt;' +\n                    '&lt;svg width=\"' + svgSize + '\" height=\"' + svgSize + '\" viewBox=\"0 0 ' + svgSize + ' ' + svgSize + '\" style=\"transform:rotate(-90deg);\"&gt;' +\n                      '&lt;circle cx=\"' + cx + '\" cy=\"' + cy + '\" r=\"' + radius + '\" stroke=\"#e0e0e0\" stroke-width=\"' + strokeWidth + '\" fill=\"none\" /&gt;' +\n                      '&lt;circle cx=\"' + cx + '\" cy=\"' + cy + '\" r=\"' + radius + '\" stroke=\"' + color + '\" stroke-width=\"' + strokeWidth + '\" fill=\"none\" ' +\n                      'stroke-dasharray=\"' + strokeDasharray + ' ' + circumference + '\" stroke-linecap=\"round\" /&gt;' +\n                    '&lt;/svg&gt;' +\n                    '&lt;div style=\"font-size:20px; margin-top:2px;\"&gt;' + value.toFixed(1) + '%&lt;/div&gt;' +\n                  '&lt;/div&gt;';\n        }\n        \n        // Build main gauges (Actual and Plan)\n        var mainGauges_html = \"\";\n        mainGauges_html += createGaugeContainer(actual_perc, \"Actual %\", \"green\");\n        mainGauges_html += createGaugeContainer(plan_perc, \"Plan %\", \"blue\");\n        \n        // Define additional gauges (if these fields exist in source_projects)\n        var fields = [\n          { key: \"EARLY_FORECAST_PERC\", label: \"Early Forecast Act's %\", color: \"orange\" },\n          { key: \"LATE_FORECAST_PERC\",  label: \"Late Forecast Act's %\",  color: \"red\" },\n          { key: \"ASON_PERC\",           label: \"On Time Act's %\",        color: \"purple\" },\n          { key: \"ASAH_PERC\",           label: \"Ahead Sch. Act's %\",      color: \"magenta\" },\n          { key: \"ASBH_PERC\",           label: \"Behind Sch. Act's %\",     color: \"brown\" },\n          { key: \"CRTITICAL_PERC\",      label: \"Critical Act's %\",        color: \"black\" },\n        ];\n        \n        var gaugesArray = [];\n        for (var i = 0; i &lt; fields.length; i++) {\n          var f = fields[i];\n          var val = convertToNumber(proj_data[f.key][project_index]);\n          gaugesArray.push(createGaugeContainer(val, f.label, f.color));\n        }\n        \n        // Organize additional gauges in rows (3 per row)\n        var gaugesPerRow = 3;\n        var additionalRows = \"\";\n        for (var i = 0; i &lt; gaugesArray.length; i++) {\n          if (i % gaugesPerRow === 0) {\n            additionalRows += '&lt;div style=\"width:100%; text-align:center;\"&gt;';\n          }\n          additionalRows += gaugesArray[i];\n          if ((i + 1) % gaugesPerRow === 0 || i === gaugesArray.length - 1) {\n            additionalRows += '&lt;/div&gt;';\n          }\n        }\n        \n        var allGauges_html = '&lt;div style=\"width:100%; margin:0 auto; text-align:center;\"&gt;' +\n                              '&lt;div&gt;' + mainGauges_html + '&lt;/div&gt;' +\n                              additionalRows +\n                              '&lt;/div&gt;';\n        gauge_div.text = allGauges_html;\n        \n        // --- Update Indicator Div (similar to your existing callback for indicators) ---\n        var indicator_names = ['Project Name', 'Actual Start Date', 'Forecast Completion Date',\n                               'Total NO.Activities', 'NO.Critical Activities', \n                               'Long DN Activities', 'High Lag Relations', 'Total MHs', 'Total Cost'];\n        var indicator_columns = ['WBS_NAME','ACT_START_DATE','EARLY_END_DATE','TASK_ID',\n                                 'TASK_CRITICAL', 'TASK_LONG_DN', 'HIGH_LAG_REL', 'TARGET_QTY', 'total_eac'];\n        var row_content = \"&lt;div style='display: flex; flex-wrap: wrap; justify-content: space-around;'&gt;\";\n        for (var i = 0; i &lt; indicator_columns.length; i++) {\n            var col = indicator_columns[i];\n            var value = proj_data[col][project_index];\n            // If the field is a date, format it\n            if (col === 'ACT_START_DATE' || col === 'EARLY_END_DATE') {\n              var date = new Date(value);\n              value = date.toLocaleDateString();\n            } else if (typeof value === 'number') {\n              if (value &gt;= 1000000) {\n                value = (value / 1000000).toFixed(2) + \" M\";\n              } else if (value &gt;= 1000) {\n                value = (value / 1000).toFixed(2) + \" K\";\n              } else {\n                value = value.toFixed(2);\n              }\n            }\n            row_content += \"&lt;div style='text-align: center; margin: 5px; width: 200px; border: 2px solid #007BFF; box-shadow: 5px 5px 13px rgba(0, 0, 0, 0.2); background-color: #f8f9fa;'&gt;\" +\n                           \"&lt;h3 style='font-size: 18px;'&gt;\" + indicator_names[i] + \"&lt;/h3&gt;\" +\n                           \"&lt;h1 style='font-size: 14px; color: blue;'&gt;\" + value + \"&lt;/h1&gt;&lt;/div&gt;\";\n                           \n        }\n        row_content += \"&lt;/div&gt;\";\n        indicator_div.text = row_content;\n    "}}]]]},"indices":[],"line_indices":[]}},"selection_policy":{"type":"object","name":"UnionRenderers","id":"p6788"},"data":{"type":"map","entries":[["wbs",[]],["plan_perc",[]],["actual_perc",[]],["Forecast_Completion",[]],["TARGET_END_DATE",[]],["F_DELAY_DAYS",[]]]}}}]]},"code":"\n    var proj_prog = select_proj_prog.value;\n    var data = source_projects.data;\n\n    var wbs_name = data['WBS_NAME'];\n    var proj_prog_data = data['PROJ_PROG'];\n    var actual_perc_data = data['Actual_Perc'];\n    var plan_perc_data = data['Plan_Perc'];\n    var EARLY_END_DATE_data = data['EARLY_END_DATE'];\n    var TARGET_END_DATE_data = data['TARGET_END_DATE'];\n    var F_DELAY_DAYS_data = data['F_DELAY_DAYS'];\n\n    // Filter data based on PROJ_PROG\n    var filtered_data = [];\n    var row_classes = [];  // To store row classes\n\n    for (var i = 0; i &lt; proj_prog_data.length; i++) {\n        if (proj_prog === \"All\" || proj_prog_data[i] === proj_prog) {\n            var row_class = \"\";  // Default class\n\n            // Check if DEV (F_DELAY_DAYS) &gt; 0, apply delayed-row class\n            if (parseFloat(F_DELAY_DAYS_data[i]) &gt; 0) {\n                row_class = \"delayed-row\";  // Apply delayed-row class\n            }\n\n            filtered_data.push({\n                wbs: wbs_name[i],\n                actual_perc: actual_perc_data[i],\n                plan_perc: plan_perc_data[i],\n                F_DELAY_DAYS: F_DELAY_DAYS_data[i],\n                TARGET_END_DATE: new Date(TARGET_END_DATE_data[i]).toLocaleDateString('en-GB', { day: '2-digit', month: 'short', year: 'numeric' }),\n                Forecast_Completion: new Date(EARLY_END_DATE_data[i]).toLocaleDateString('en-GB', { day: '2-digit', month: 'short', year: 'numeric' }),\n                row_class: row_class  // Add the row_class to the data\n            });\n        }\n    }\n\n    // Sort by Forecast_Completion\n    filtered_data.sort((a, b) =&gt; new Date(a.Forecast_Completion) - new Date(b.Forecast_Completion));\n\n    // Update Actual % table data\n    actualPercSource.data = {\n        wbs: filtered_data.map(item =&gt; item.wbs),\n        actual_perc: filtered_data.map(item =&gt; parseFloat(item.actual_perc).toFixed(2)),\n        plan_perc: filtered_data.map(item =&gt; parseFloat(item.plan_perc).toFixed(2)),\n        Forecast_Completion: filtered_data.map(item =&gt; item.Forecast_Completion),\n        TARGET_END_DATE: filtered_data.map(item =&gt; item.TARGET_END_DATE),\n        F_DELAY_DAYS: filtered_data.map(item =&gt; parseFloat(item.F_DELAY_DAYS)),\n        row_class: filtered_data.map(item =&gt; item.row_class)  // Include the row class\n    };\n    "}}]]]},"title":"Select Program","options":["All","R11_12_13","R_NON_Shura","R_SHURA"],"value":"All"}},{"id":"p6716"}]}},{"type":"object","name":"Spacer","id":"p6955","attributes":{"height":5}},{"type":"object","name":"Div","id":"p6894","attributes":{"width":400,"height":50,"text":"&lt;h1 style='text-align:center;color:red;'&gt;Schedules KPIs&lt;/h1&gt;"}},{"type":"object","name":"Row","id":"p6958","attributes":{"sizing_mode":"scale_width","children":[{"type":"object","name":"Row","id":"p6956","attributes":{"children":[{"type":"object","name":"Row","id":"p6941","attributes":{"children":[{"id":"p6776"},{"type":"object","name":"Spacer","id":"p6940","attributes":{"width":80}},{"id":"p6777"}]}}]}},{"type":"object","name":"Spacer","id":"p6957","attributes":{"width":10}},{"type":"object","name":"DataTable","id":"p6883","attributes":{"height":800,"source":{"id":"p6786"},"view":{"type":"object","name":"CDSView","id":"p6887","attributes":{"filter":{"type":"object","name":"AllIndices","id":"p6888"}}},"columns":[{"type":"object","name":"TableColumn","id":"p6859","attributes":{"field":"wbs","title":"Asset","width":350,"formatter":{"type":"object","name":"StringFormatter","id":"p6860"},"editor":{"type":"object","name":"StringEditor","id":"p6861"}}},{"type":"object","name":"TableColumn","id":"p6862","attributes":{"field":"actual_perc","title":"Actual %","width":15,"formatter":{"type":"object","name":"StringFormatter","id":"p6863"},"editor":{"type":"object","name":"StringEditor","id":"p6864"}}},{"type":"object","name":"TableColumn","id":"p6865","attributes":{"field":"plan_perc","title":"Plan %","width":10,"formatter":{"type":"object","name":"StringFormatter","id":"p6866"},"editor":{"type":"object","name":"StringEditor","id":"p6867"}}},{"type":"object","name":"TableColumn","id":"p6868","attributes":{"field":"Forecast_Completion","title":"Forecast/Act","width":110,"formatter":{"type":"object","name":"StringFormatter","id":"p6869"},"editor":{"type":"object","name":"StringE
